import './App.css';
import { loginUser } from './Redux/reducer';
import { useDispatch } from 'react-redux';
import { loginUserThunk } from './services';
function App() {
  const dispatch = useDispatch()
  return (
    <div className="App">
      <button onClick={() => dispatch(loginUser({ name: 'rizwan', email: 'khan@gmail.com' }))}>
        login
      </button>
      <button onClick={() => dispatch(loginUserThunk({ name: 'rizwan', email: 'khan@gmail.com' }))}>
        get details
      </button>
    </div>
  );
}

export default App;
